        //
        // Summary:
        //     Occurs when the client is disconnected from the gateway.
        public event EventHandler ClientDisconnected;

        public void RaiseClientDisconnected(object sender = null, EventArgs args = null)
        {
            ClientConnected?.Invoke(sender ?? this, args ?? new EventArgs());
        }
        //
        // Summary:
        //     Occurs when the client is connected to gateway.
        public event EventHandler ClientConnected;

        public void RaiseClientConnected(object sender = null, EventArgs args = null)
        {
            ClientDisconnected?.Invoke(sender ?? this, args ?? new EventArgs());
        }


