            //
            // Summary:
            //     Asynchronously invokes an administrative command on the given infrastructure
            //     service instance.
            //
            // Parameters:
            //   serviceName:
            //     The name of the target infrastructure service instance.
            //
            //   command:
            //     The text of the command to be invoked. The content of the command is infrastructure-specific.
            //
            // Returns:
            //     The response from the infrastructure service. The response format is a JSON string.
            //     The contents of the response depend on which command was issued.
            public Task<string> InvokeInfrastructureCommandAsync(Uri serviceName, string command) { return Task.FromResult("{ \"ok\" : true }"); }
            //
            // Summary:
