            //
            //   timeout:
            //     The maximum amount of time Service Fabric will allow this operation to continue
            //     before returning a System.TimeoutException.
            //
            //   cancellationToken:
            //     The optional cancellation token that the operation is observing. It can be used
            //     to send a notification that the operation should be canceled. Note that cancellation
            //     is advisory and that the operation may still be completed even if it is cancelled.
            //
            // Returns:
            //     The response from the infrastructure service. The response format is a JSON string.
            //     The contents of the response depend on which command was issued.
            public Task<string> InvokeInfrastructureCommandAsync(Uri serviceName, string command, TimeSpan timeout, CancellationToken cancellationToken) { return Task.FromResult("{ \"ok\" : true }"); }
