        //
        // Summary:
        //     Allows client side creation, deletion, and inspection of service groups inside
        //     the cluster, just like the System.Fabric.FabricClient.ServiceManagementClient
        //     for regular services.
        public class ServiceGroupManagementClient
        {
            private List<ServiceGroupDescription> _serviceGroupDescriptions = new List<ServiceGroupDescription>();
            //
            // Summary:
            //     Asynchronously creates a service group from the given System.Fabric.Description.ServiceGroupDescription.
            //
            // Parameters:
            //   description:
            //     The System.Fabric.Description.ServiceGroupDescription which describes the group
            //     and its members.
            //
            // Returns:
            //     The task representing the asynchronous service group creation operation.
            public Task CreateServiceGroupAsync(ServiceGroupDescription description)
            {
                _serviceGroupDescriptions.Add(description);
                return Task.FromResult(true);
            }
            //
            // Summary:
            //     Asynchronously creates a service group from the given System.Fabric.Description.ServiceGroupDescription
            //     with the provided timeout and System.Threading.CancellationToken.
            //
            // Parameters:
            //   description:
            //     The System.Fabric.Description.ServiceGroupDescription which describes the group
            //     and its members.
            //
            //   timeout:
            //     Timespan that defines the maximum amount of time Service Fabric will allow this
            //     operation to continue before returning a Timeout Exception.
            //
            //   cancellationToken:
            //     The System.Threading.CancellationToken object that the operation is observing.
            //     It can be used to send a notification that the operation should be canceled.
            //     Note that cancellation is advisory and that the operation may still be completed
            //     even if it is canceled.
            //
            // Returns:
            //     The task representing the asynchronous service group creation operation.
            public Task CreateServiceGroupAsync(ServiceGroupDescription description, TimeSpan timeout, CancellationToken cancellationToken)
            {
                return CreateServiceGroupAsync(description);
            }

            //
            // Summary:
            //     Creates a Service Group from a Service Group Template that is pre-defined in
            //     the current Application Manifest.
            //
            // Parameters:
            //   applicationName:
            //     Application name for the Service Group
            //
            //   serviceName:
            //     Service name for the Service Group
            //
            //   serviceTypeName:
            //     Service Type Name for the Service Group
            //
            //   initializationData:
            //     Initialization data to pass into the Service Group instance
            //
            // Returns:
            //     The task representing the asynchronous service group creation operation.
            public Task CreateServiceGroupFromTemplateAsync(Uri applicationName, Uri serviceName, string serviceTypeName, byte[] initializationData)
            {
                var param = new object[] { ServiceDescriptionKind.Stateful };
                var serviceDescription = CreateInstance<ServiceDescription>();
                serviceDescription.ApplicationName = applicationName;
                serviceDescription.ServiceName = serviceName;
                serviceDescription.ServiceTypeName = serviceTypeName;
                serviceDescription.InitializationData = initializationData;
                return CreateServiceGroupAsync(new ServiceGroupDescription(serviceDescription));
            }

            //
            // Summary:
            //     Creates a service group from a Service Group Template that is pre-defined in
            //     the current Application Manifest.
            //
            // Parameters:
            //   applicationName:
            //     Application name for the Service Group
            //
            //   serviceName:
            //     Service name for the Service Group
            //
            //   serviceTypeName:
            //     Service Type Name for the Service Group
            //
            //   initializationData:
            //     Initialization data to pass into the Service Group instance
            //
            //   timeout:
            //     Maximum allowed time for the operation to complete before TimeoutException is
            //     thrown.
            //
            //   cancellationToken:
            //     The System.Threading.CancellationToken that the operation is observing. It can
            //     be used to send a notification that the operation should be canceled. Note that
            //     cancellation is advisory and that the operation may still be completed even if
            //     it is cancelled.
            //
            // Returns:
            //     The task representing the asynchronous service group creation operation.
            public Task CreateServiceGroupFromTemplateAsync(Uri applicationName, Uri serviceName, string serviceTypeName, byte[] initializationData, TimeSpan timeout, CancellationToken cancellationToken)
            {
                return CreateServiceGroupFromTemplateAsync(applicationName, serviceName, serviceTypeName, initializationData);
            }
            //
            // Summary:
            //     Creates a service group from a Service Group Template that is pre-defined in
            //     the current Application Manifest.
            //
            // Parameters:
            //   serviceGroupFromTemplateDescription:
            //     Describes the Service Group to be created from Service Group Template specified
            //     in Application Manifest.
            //
            // Returns:
            //     The task representing the asynchronous service group creation operation.
            public Task CreateServiceGroupFromTemplateAsync(ServiceGroupFromTemplateDescription serviceGroupFromTemplateDescription)
            {
                return CreateServiceGroupFromTemplateAsync(serviceGroupFromTemplateDescription.ApplicationName, serviceGroupFromTemplateDescription.ServiceName, serviceGroupFromTemplateDescription.ServiceTypeName, serviceGroupFromTemplateDescription.InitializationData);
            }

            //
            // Summary:
            //     Creates a service group from a Service Group Template that is pre-defined in
            //     the current Application Manifest.
            //
            // Parameters:
            //   serviceGroupFromTemplateDescription:
            //     Describes the Service Group to be created from Service Group Template specified
            //     in Application Manifest.
            //
            //   timeout:
            //     Maximum allowed time for the operation to complete before TimeoutException is
            //     thrown.
            //
            //   cancellationToken:
            //     The System.Threading.CancellationToken that the operation is observing. It can
            //     be used to send a notification that the operation should be canceled. Note that
            //     cancellation is advisory and that the operation may still be completed even if
            //     it is cancelled.
            //
            // Returns:
            //     The task representing the asynchronous service group creation operation.
            public Task CreateServiceGroupFromTemplateAsync(ServiceGroupFromTemplateDescription serviceGroupFromTemplateDescription, TimeSpan timeout, CancellationToken cancellationToken)
            {
                return CreateServiceGroupFromTemplateAsync(serviceGroupFromTemplateDescription.ApplicationName, serviceGroupFromTemplateDescription.ServiceName, serviceGroupFromTemplateDescription.ServiceTypeName, serviceGroupFromTemplateDescription.InitializationData);
            }

            //
            // Summary:
            //     Asynchronously deletes the specified service group.
            //
            // Parameters:
            //   serviceGroupName:
            //     The name of the service group to be deleted.
            //
            // Returns:
            //     The task representing the asynchronous service group delete operation.
            //
            // Exceptions:
            //   T:System.Fabric.FabricObjectClosedException:
            //     The System.Fabric.FabricClient object is in a closed state. Dispose of the System.Fabric.FabricClient
            //     object you are using and instantiate a new System.Fabric.FabricClient object.
            public Task DeleteServiceGroupAsync(Uri serviceGroupName)
            {
                _serviceGroupDescriptions.RemoveAll(d => d.ServiceDescription.ServiceName == serviceGroupName);
                return Task.FromResult(true);
            }
            //
            // Summary:
            //     Asynchronously deletes the specified service group with the provided timeout
            //     and System.Threading.CancellationToken.
            //
            // Parameters:
            //   serviceGroupName:
            //     The name of the service group to be deleted.
            //
            //   timeout:
            //     Timespan that defines the maximum amount of time Service Fabric will allow this
            //     operation to continue before returning a Timeout Exception.
            //
            //   cancellationToken:
            //     The System.Threading.CancellationToken object that the operation is observing.
            //     It can be used to send a notification that the operation should be canceled.
            //     Note that cancellation is advisory and that the operation may still be completed
            //     even if it is cancelled.
            //
            // Returns:
            //     The task representing the asynchronous service group delete operation.
            //
            // Exceptions:
            //   T:System.Fabric.FabricObjectClosedException:
            //     The System.Fabric.FabricClient object is in a closed state. Dispose of the System.Fabric.FabricClient
            //     object you are using and instantiate a new System.Fabric.FabricClient object.
            public Task DeleteServiceGroupAsync(Uri serviceGroupName, TimeSpan timeout, CancellationToken cancellationToken)
            {
                return DeleteServiceGroupAsync(serviceGroupName);
            }
            //
            // Summary:
            //     Asynchronously fetches the System.Fabric.Description.ServiceGroupDescription
            //     for the specified service group, if it exists.
            //
            // Parameters:
            //   serviceGroupName:
            //     The name of the service group whose System.Fabric.Description.ServiceGroupDescription
            //     should be fetched.
            //
            // Returns:
            //     The task representing the asynchronous operation.
            //
            // Exceptions:
            //   T:System.Fabric.FabricObjectClosedException:
            //     The System.Fabric.FabricClient object is in a closed state. Dispose of the System.Fabric.FabricClient
            //     object you are using and instantiate a new System.Fabric.FabricClient object.
            public Task<ServiceGroupDescription> GetServiceGroupDescriptionAsync(Uri serviceGroupName)
            {
                var first = _serviceGroupDescriptions.FirstOrDefault(d => d.ServiceDescription.ServiceName == serviceGroupName);
